import React from 'react';
import './ContactMe.css'
import './ContactInfo.js'

function ContactMe() {
    return (
        <div className="container">
            <header className="Contact-Header">Contact Me</header>
            <p>{document.getElementById("name")}</p>
        </div>
    )
}

export default ContactMe;
